// src/components/EnrollmentDetails.js
import React from 'react';
import { useParams } from 'react-router-dom';

const EnrollmentDetails = () => {
    const { name, age, selectedBatch, enrollmentDate, paymentDetails } = useParams();

    return (
        <div>
     
            <h2>Enrollment Details</h2>
            <p><strong>Name:</strong> {name}</p>
            <p><strong>Age:</strong> {age}</p>
            <p><strong>Selected Batch:</strong> {selectedBatch}</p>
            <p><strong>Enrollment Date:</strong> {enrollmentDate}</p>
            <p><strong>Payment Details:</strong> {paymentDetails}</p>
            
        </div>
    );
};

export default EnrollmentDetails;
